import React, { Component } from 'react';
import Cart from './Cart';


export class Carts extends Component {
  render() {
    return (
      <main>
            {this.props.items.map(el => ( 
               <Carts key={el.id} item = {el}/>))}
        </main>
    )
  }
}

export default Carts
